import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { list_orders } from '../actions/orders'

const Dashboard = (
    orders,
    list_orders
) => {

    useEffect(() => {
        list_orders();
    }, []);
    return (
        <div>
            Dashboard
        </div>
    )
};

const mapStateToProps = state => ({
    orders: state.orders.orders
});

export default connect(mapStateToProps, {
    list_orders,
})(Dashboard);
